"""## Experimenting with Attribute Combinations

calculate volume of diamond and add it to data
"""

data['volume']=data['x']*data['y']*data['z']

"""![Screenshot 2021-08-17 101803.png](data:image/png;base64,)"""

data['volume_1']=(data['carat']*0.2)/3.51

data.drop("carat",axis=1, inplace = True)         #remove column carat from data

data.drop(columns=['x','y','z'],inplace=True)

"""## Prepare the Data for Machine Learning Algorithms (data clean)"""

# we tried to drop the features with low correlation like depth but it was worse

data.drop("Unnamed: 0",axis=1, inplace = True)         #remove column of unnamed from data

(data==0).sum(axis=0)                                  #detect if there is zero in data

data=data.drop(data[data['volume']==0].index)

(data==0).sum(axis=0)

plt.figure(figsize=(12,8))
sns.heatmap(data.corr(), annot=True, cmap='viridis',)
plt.suptitle("diamond corr()")

"""It is clear from the table and plot the following:


1.   The price is strongly correlated with the carat, volume_1 and volume.

2.   The price is poorly correlated with table

3.   The price is inversly correlated with depth

## Create a train && Test Set
"""

# we also tried to use train_test_split But it was worse

data['price'].quantile([0.25,0.50,0.75])

data["price_new"] = pd.cut(data["price"],                                                                    
 bins=[0., 949.00, 2401.00, 5323.25, np.inf],       
 labels=[1, 2, 3, 4])                         
data[["price_new",'price']]

data["price_new"].hist()

split = StratifiedShuffleSplit(n_splits=1, test_size=0.2, random_state=42)
for train_index, test_index in split.split(data, data["price_new"]):
 train_set = data.iloc[train_index]
 test_set = data.iloc[test_index]

print(test_set["price_new"].value_counts() / len(test_set))
print(train_set["price_new"].value_counts() / len(train_set))
print(data["price_new"].value_counts() / len(data))

for set_ in (train_set, test_set):
 set_.drop("price_new", axis=1, inplace=True)

strat_train_set= train_set.copy()
train_setx= train_set.drop(['price'],axis=1)
train_labels= train_set['price']
strat_test_set= test_set.copy()
test_setx= test_set.drop(['price'],axis=1)
test_labels= test_set['price']

"""## Transformation Pipelines"""

# we also tried to use MinMaxScaler But it was worse

num_features = list(train_setx.drop(['cut','color','clarity'],axis=1))
cut_feature = ['cut']
color_feature = ['color']
clarity_feature = ['clarity']

cut_encoder = OrdinalEncoder(categories=[['Fair','Good','Very Good','Premium','Ideal']])         # الجديد

color_encoder = OrdinalEncoder(categories=[['J','I','H','G','F','E','D']])

clarity_encoder = OrdinalEncoder(categories=[['I1','SI2','SI1','VS2','VS1','VVS2','VVS1','IF']])

num_pipeline = Pipeline([  
 ('std_scaler', StandardScaler()),
 ])

full_pipeline = ColumnTransformer([                
 ("num", num_pipeline, num_features),               
 ("cut", cut_encoder, cut_feature),
 ("color", color_encoder , color_feature),
 ("clarity", clarity_encoder , clarity_feature),            
 ])                                                
train_setx_p = full_pipeline.fit_transform(train_setx)

train_setx=pd.DataFrame(data = train_setx_p, columns = train_setx.columns, index = train_setx.index)

train_setx.describe()

train_setx.head()

"""## Select and Train a Model"""

from sklearn.linear_model import LinearRegression              # LinearRegression
lin_reg = LinearRegression()
lin_reg.fit(train_setx,train_labels)

from sklearn.model_selection import cross_val_score           # cross validation score
scores = cross_val_score(lin_reg , train_setx, train_labels,scoring="neg_mean_squared_error", cv=10)  
rmse_scores = np.sqrt(-scores)
print('mean (with cross_val)', rmse_scores.mean())

from sklearn.tree import DecisionTreeRegressor                 # DecisionTreeRegressor
tree_reg = DecisionTreeRegressor()
tree_reg.fit(train_setx, train_labels)

from sklearn.model_selection import cross_val_score           # cross validation score
scores = cross_val_score(tree_reg , train_setx, train_labels,scoring="neg_mean_squared_error", cv=10)  
rmse_scores = np.sqrt(-scores)
print('mean (with cross_val)', rmse_scores.mean())

from sklearn.ensemble import RandomForestRegressor             # RandomForestRegressor
forest_reg = RandomForestRegressor()            # we try aonther hyperparameter such us criterion='mae'
forest_reg.fit(train_setx, train_labels)

from sklearn.model_selection import cross_val_score           # cross validation score
scores = cross_val_score(forest_reg , train_setx, train_labels,scoring="neg_mean_squared_error", cv=10)  
rmse_scores = np.sqrt(-scores)
print('mean (with cross_val)', rmse_scores.mean())

train_accuracy = forest_reg.score(train_setx,train_labels)*100
print ('accuracy: ',train_accuracy)

predicted = forest_reg.predict(train_setx)
expected = train_labels
train_setx['error'] = expected-predicted

train_setx['error'].hist(bins=500, figsize=(15,10))

"""# Fine-Tune Your Model"""

from sklearn.model_selection import GridSearchCV
param_grid = [
 {'n_estimators': [100,300,500], 'max_features': [2,4,6]},
 ]
forest_reg = RandomForestRegressor()
grid_search = GridSearchCV(forest_reg, param_grid, cv=5, scoring='neg_mean_squared_error',return_train_score=True)
grid_search.fit(train_setx,train_labels)

grid_search.best_params_

grid_search.best_estimator_

cvres = grid_search.cv_results_
for mean_score, params in zip(cvres["mean_test_score"], cvres["params"]):
 print(np.sqrt(-mean_score), params)

"""# Evaluate Your System on the Test Set

"""

test_setx_p = full_pipeline.transform(test_setx)
test_setx=pd.DataFrame(data = test_setx_p, columns = test_setx.columns, index = test_setx.index)

test_setx.head()

final_model = grid_search.best_estimator_
final_predictions = final_model.predict(test_setx)
final_mse = mean_squared_error(test_labels, final_predictions)
final_rmse = np.sqrt(final_mse)
print ('RMSE',final_rmse)
test_accuracy = final_model.score(test_setx,test_labels)*100
print ('accuracy',test_accuracy)